import './App.css';
import { Component } from 'react';

function Saludar(props){
  return <div>
    <h1>{props.title}</h1>
    <p>Mi curso react</p>
  </div>
}

function sumar(x,y){
  return <div>
    <h1>La suma es {x+y}</h1>
  </div>
}

class App extends Component {


  render() {
    return (
      <>

        <Saludar title="Hola Mundo"/>
        <Saludar title="Mi primer react"/>
        {sumar(30,30)}
      </>
    );
  }
}

export default App;
